import React, { Component } from 'react';


class InsertPage extends Component {
    constructor(props) {
        super(props);
        this.state ={
            sbname: "",
            startdate: "",
            enddate:"",
            timezone: "",
            starttime: "",
            endtime: "",
            callduration: ""
        }
        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
      }
      handleChange(event) {
        this.setState({[event.target.name]: event.target.value});
        
      }
    
      handleSubmit(event) {
        alert(this.state.sbname+"/n"+this.state.startdate+"/n"+this.state.enddate);

      }
  render() {
    return (
      <div className="InsertPage">
      <h1> General Info </h1>
        <form  onSubmit={this.handleSubmit}>
  <label>
    Submitted By:
    <input type="text" name="sbname" onChange={this.handleChange}/>
  </label>
    
  <label>
  Start Date:
    <input type = "text" name= "startdate" onChange={this.handleChange}/>    
  </label>
  <label>
      End Date: 
      <input type = "text" name = "enddate" onChange={this.handleChange}/>
  </label>
  <label>
      Time Zone: 
      <input type = "text " name = "timezone" onChange={this.handleChange}/>
  </label>
  <label>
      Start Time:
      <input type =    "text" name = "starttime" onChange={this.handleChange}/>

  </label>
  <label>
      End Time:
      <input type =    "text" name = "endtime" onChange={this.handleChange}/>
      
  </label>
  <label>
      Call Duration:
      <input type =    "text" name = "callduration" onChange={this.handleChange}/>
      
  </label>
  
  <input type="submit" value="Submit" onSubmit={this.handleSubmit}/>
</form>


      </div>
    );
  }
}

export default InsertPage;
